import { Outlet, Link } from "react-router-dom";
import { Fragment } from "react";

const Navigation = () => {
  return (
    <Fragment>
      <div className='navigation'>
        <h1>This is the navigation bar</h1>
        <Outlet />
      </div>
    </Fragment>
  );
};

export default Navigation;
